import React, { useEffect, useState } from "react";
import { useAddBookingMutation } from "../../redux/api/bookingApi";
import { useGetUsersQuery } from "../../redux/api/adminApi";
import { useGetFlightTypesQuery } from "../../redux/api/flightTypeApi";

const BookingForm = ({ refetch }) => {
  const { data: users } = useGetUsersQuery();
  const { data: flightTypes } = useGetFlightTypesQuery();
  const [addBooking] = useAddBookingMutation();
  const [form, setForm] = useState({
    user: "",
    fromPlace: "",
    toPlace: "",
    travelDate: "",
    travelTime: "",
    flightType: "",
    remarks: "",
    totalAmount: 0,
  });

  useEffect(() => {
    const user = users?.find((u) => u._id === form.user);
    if (user) {
      setForm((prev) => ({
        ...prev,
        travelerName: user.name,
        email: user.email,
        mobile: user.mobile,
      }));
    }
  }, [form.user, users]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await addBooking(form);
      setForm({
        user: "",
        fromPlace: "",
        toPlace: "",
        travelDate: "",
        travelTime: "",
        flightType: "",
        remarks: "",
        totalAmount: 0,
      });
      refetch();
      alert("Booking added successfully");
    } catch (err) {
      alert("Error: " + err.message);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="mb-4">
      <h4>Add Booking</h4>
      <div className="row">
        <div className="col-md-4">
          <label>Traveler</label>
          <select
            className="form-select"
            value={form.user}
            onChange={(e) => setForm({ ...form, user: e.target.value })}
            required
          >
            <option value="">Select Traveler</option>
            {users?.users?.map((u) => (
              <option key={u._id} value={u._id}>
                {u.name} ({u.email})
              </option>
            ))}
          </select>
        </div>
        <div className="col-md-4">
          <label>From</label>
          <input
            type="text"
            className="form-control"
            value={form.fromPlace}
            onChange={(e) => setForm({ ...form, fromPlace: e.target.value })}
            required
          />
        </div>
        <div className="col-md-4">
          <label>To</label>
          <input
            type="text"
            className="form-control"
            value={form.toPlace}
            onChange={(e) => setForm({ ...form, toPlace: e.target.value })}
            required
          />
        </div>
      </div>
      <div className="row mt-2">
        <div className="col-md-3">
          <label>Travel Date</label>
          <input
            type="date"
            className="form-control"
            value={form.travelDate}
            onChange={(e) => setForm({ ...form, travelDate: e.target.value })}
            required
          />
        </div>
        <div className="col-md-3">
          <label>Travel Time</label>
          <input
            type="time"
            className="form-control"
            value={form.travelTime}
            onChange={(e) => setForm({ ...form, travelTime: e.target.value })}
            required
          />
        </div>
        <div className="col-md-3">
          <label>Flight Type</label>
          <input
            type="text"
            className="form-control"
            value={form.flightType}
            onChange={(e) => setForm({ ...form, flightType: e.target.value })}
            required
          />
        </div>
        <div className="col-md-3">
          <label>Total Amount</label>
          <input
            type="number"
            className="form-control"
            value={form.totalAmount}
            onChange={(e) => setForm({ ...form, totalAmount: +e.target.value })}
            required
          />
        </div>
      </div>
      <div className="mt-2">
        <label>Remarks</label>
        <textarea
          className="form-control"
          rows={2}
          value={form.remarks}
          onChange={(e) => setForm({ ...form, remarks: e.target.value })}
        ></textarea>
      </div>
      <button type="submit" className="btn btn-primary mt-3">
        Save Booking
      </button>
    </form>
  );
};

export default BookingForm;
